import React, { Suspense, lazy } from "react";
import { Route, Link, Navigate, RouterProvider, createBrowserRouter, createRoutesFromElements} from 'react-router-dom'
// const Auth = lazy(() => import('./Auth/Auth'))
import {Header} from "./FirstPage/Header/Header"
const FirstPage = lazy(() => import('./FirstPage/FirstPage'))
const Auth = lazy(() => import('./Auth/Auth'))

const router = createBrowserRouter(createRoutesFromElements(
    <Route path="/" element={<Auth />} />,
    <Route path="/" element={<Layout />}>
        <Route path="first-page" element={<Suspense fallback={<h1>Loading...</h1>}><FirstPage /></Suspense>}/>
        <Route path="second-page" element={<Suspense fallback={<h1>Loading...</h1>}><SecondPage /></Suspense>}/>
    </Route>
    // <Route path="/" >
    //     <Route index  element={<Suspense fallback={<h1>Loading...</h1>}><Auth /></Suspense>}/>
    //     <Route path="/App/*" element={<Header />}>
    //         <Route path="FirstPage" element={<Suspense fallback={<h1>Loading...</h1>}><FirstPage /></Suspense>}/> 
    //         {/* <Route path="SecondPage" element={<Suspense fallback={<h1>Loading...</h1>}><SecondPage /></Suspense>}/> */}
    //     </Route>

    // </Route>
))

const Main = () => {
    return(
        <div className="main">
            <RouterProvider router={router} />
        </div>
    )
}

export {Main}

